export default function EventViewer() {
  const [page, setPage] = React.useState(0);
  const [rowsPerPage, setRowsPerPage] = React.useState(10);

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const [EVENTS, setEVENTS] = useState([]);

  useEffect(() => {
    Axios.get('http://localhost:3001/api/getEVENTS').then((response) => {
      setEVENTS(response.data);
    });
  }, []);
  return (
    <Page title="Event Viewer">
      <Container maxWidth="xl">
        <Stack direction="row" alignItems="center" justifyContent="space-between" mb={3}>
          <Typography variant="h4" gutterBottom style={{ color: '#66fcf1' }}>
            Event Viewer
          </Typography>
        </Stack>
        <Paper sx={{ width: '100%', overflow: 'hidden' }} style={{ backgroundColor: '#1f2833' }}>
          <TableContainer sx={{ minHeight: 693 }}>
            <Table stickyHeader aria-label="sticky table" style={{ backgroundColor: '#c5c6c7' }}>
              <TableHead style={{ backgroundColor: '#c5c6c7' }}>
                <TableRow>
                  {columns.map((column) => (
                    <TableCell
                      key={column.id}
                      align={column.align}
                      style={{
                        minWidth: column.minWidth,
                        color: '#fff',
                        backgroundColor: '#45a29e',
                        fontWeight: 'bolder'
                      }}
                    >
                      {column.label}
                    </TableCell>
                  ))}
                </TableRow>
              </TableHead>
              <TableBody>
                {EVENTS.map((row) => (
                  <TableRow hover role="checkbox" tabIndex={-1} key={row.code}>
                    {columns.map((column) => {
                      const value = row[column.id];
                      return (
                        <TableCell
                          key={column.id}
                          align={column.align}
                          style={{
                            minWidth: column.minWidth,
                            color: '#45a29e',
                            backgroundColor: '#1f2833',
                            fontSize: '1.2em',
                            fontFamily: 'monospace'
                          }}
                        >
                          {column.format && typeof value === 'number'
                            ? column.format(value)
                            : value}
                        </TableCell>
                      );
                    })}
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
          <TablePagination
            component="div"
            count={EVENTS.length}
            rowsPerPage={rowsPerPage}
            page={page}
            onPageChange={handleChangePage}
            style={{
              color: '#45a29e',
              backgroundColor: '#1f2833',
              fontSize: '1.2em',
              fontFamily: 'monospace'
            }}
          />
        </Paper>
      </Container>
    </Page>
  );
}
